import React, { useState, useEffect } from 'react';

import IdintetyList from './IdintetyList';
import classes from './GetAllUsers.module.css';
import LoadingSppiner from '../../layout/LoadingSppiner';

import axios from 'axios';

const MyProfile = () => {
  const [idintety, setIdintety] = useState([]);
  const [loading, setLoading] = useState(false);
  const url = 'http://localhost:3001/identefier';

  // axios.get(url)
  //      .then((res) => setIdintety(res) )
  //      .catch((err) => {
  //        if (err) {
  //          setError("Some Thind Went Wrong");
  //        }
  //      });

  useEffect(() => {
    setLoading(true);
    axios
      .get(url)
      .then((res) => {
        setIdintety(res.data);
        setLoading(false);
      })
      .catch((err) => {
        if (err) {
          console.log('Some Thing Went Wrong');
        }
      });
  }, [url]);

  // useEffect(() => {
  //   setLoading(true);
  //   setTimeout(() => {
  //     fetch(url)
  //       .then((res) => {
  //         if (!res.ok) {
  //           throw Error('Failed To Get The Users Idintety');
  //         }
  //         return res.json();
  //       })
  //       .then((data) => {
  //         setIdintety(data);
  //         console.log(data);
  //         setLoading(false);
  //       })
  //       .catch((err) => {
  //         if (err.name === 'AbortError') {
  //           console.log('Abort Error');
  //         } else {
  //           console.log(err.message);
  //         }
  //       });
  //   }, 1000);
  // }, [url]);

  const deleteHandeler = (id) => {
    fetch(`http://localhost:3001/delete/email/${id}`, {
      method: 'DELETE',
    }).then((res) => res.json());

    fetch(`http://localhost:3001/remove/info/${id}`, {
      method: 'DELETE',
    }).then((res) => res.json());
  };
  return (
    <>
      <div className={classes.actions}>
        <h1>All Users</h1>
      </div>
      {loading ? (
        <LoadingSppiner />
      ) : (
        <IdintetyList idintetyInfo={idintety} onDelete={deleteHandeler} />
      )}
    </>
  );
};

export default MyProfile;
